import React, { createContext } from 'react'

const PageData = createContext()


function DataContext (props){

  // console.log(props)

  let tae = {
    name: props.page,
    location: 'chicago'
  }
  return (
    <PageData.Provider value={tae}>
      {props.children}
    </PageData.Provider>
  )
}

export default DataContext
